import React, { useState } from 'react';
import './App.css';
import Objective from "./components/Card/Objective.js"
import Sidebar from "./components/Sidebar/Sidebar.js"

const [data, setData] = useState(JSON.parse('{"objective":[{"title":"Objective 1", "id":"1", "task":[{"id": "3","title": "task1","specific": "sasdad","measurable": "ad","achievable": "ads","relevant": "asd","status": "asd"}, {"id": "4","title": "task2","specific": "sasdad","measurable": "ad","achievable": "ads","relevant": "asd","status": "asd"}]},{"title":"Objective 2","id":"2","task":[{"id": "5","title": "task12","specific": "sasdad","measurable": "ad","achievable": "ads","relevant": "asd","status": "asd"}, {"id": "6","title": "task22","specific": "sasdad","measurable": "ad","achievable": "ads","relevant": "asd","status": "asd"}]}]}'));
//data.objective=[...data.objective, {"title":"Objective 1", "id":"3", "task":[{"id": "8","title": "task1","specific": "sasdad","measurable": "ad","achievable": "ads","relevant": "asd","status": "asd"}, {"id": "9","title": "task2","specific": "sasdad","measurable": "ad","achievable": "ads","relevant": "asd","status": "asd"}]}])}>

function App() {
    return (<div className="App">{/*<Sidebar />*/}
        { setData(data)}
        <div className="content">{data.objective.map(objective =>
            <Objective key={objective.id} objective={objective}/>)}
        </div>
    </div>);
}

export default App;
